import React, { Component } from 'react'
import Particles from "react-particles-js";
export class Particles_component extends Component
{
    render()
    {
        return (

            <div
                style={{
                    position: "absolute",
                    top: 0,
                    left: 0,
                    width: "100%",
                    height: "100%"
                }}
            >
                <Particles
                    params={{
                        particles: {
                            "fullScreen": {
                                "enable": true,
                                "zIndex": 1
                            },
                            number: {
                                value: 100
                            },
                            color: {
                                value: "random",
                                animation: {
                                    enable: true,
                                    speed: 50,
                                    sync: false
                                }
                            },
                            shape: {
                                type: "circle",
                            },
                            size: {
                                value: 5,
                                random: true,
                                animation: {
                                    enable: true,
                                    speed: 16,
                                    minimumValue: 0.1,
                                    sync: false
                                }
                            },
                            links: {
                                enable: false,
                                distance: 100,
                                color: "random",
                                opacity: 0.4,
                                width: 1
                            },
                            move: {
                                enable: true,
                            },
                        },
                        interactivity: {
                            detectsOn: "canvas",
                            events: {
                                onHover: {
                                    enable: true,
                                    mode: "repulse"
                                },
                                onClick: {
                                    enable: true,
                                    mode: "bubble"
                                },
                                resize: true
                            },
                            modes: {
                                grab: {
                                    distance: 400,
                                    links: {
                                        opacity: 1
                                    }
                                },
                                bubble: {
                                    distance: 400,
                                    size: 40,
                                    duration: 2,
                                    opacity: 0.8
                                },
                                repulse: {
                                    distance: 200
                                },
                                push: {
                                    quantity: 4
                                },
                                remove: {
                                    quantity: 2
                                }
                            }
                        },
                        detectRetina: true,
                    }}
                />

            </div>
        )
    }
}

export default Particles_component
